import React, { Component } from "react";
import { Joystick } from "react-joystick-component";

class Teleoperation extends Component {
  state = {};
  handleMove() {}
  handleStop() {}
  render() {
    return (
      <div>
        <h2>Teleoperation</h2>
        <Joystick
          size={100}
          sticky={false}
          baseColor="#EEEEEE"
          stickColor="#BBBBBB"
          move={this.handleMove}
          stop={this.handleStop}
        ></Joystick>
      </div>
    );
  }
}

export default Teleoperation;
